import React from 'react';
import { Col, Row } from 'react-bootstrap';
import DropZone from '../../components/dropzone/dropzone.component';


const ResultEntryImport = (props) => {


    return (
        <Row>
            <Col md={12}>
                <DropZone
                    name='ResultFile'
                    label='Result File'
                    maxFiles={1}
                    // accept=".pdf"
                    minSize={0}
                    maxSize={20}
                    multiple={false}
                    // attachmentTypeCode={attachmentType.FTP}
                    editFiles={props.selectedImportFile && props.selectedImportFile}
                    isMandatory={true}
                    fileSizeName="nfilesize"
                    fileName="sfilename"
                    onDrop={(event) => props.onDropFile(event)}
                    deleteAttachment = {props.deleteAttachment}
                />
            </Col>
        </Row>
    )
}


export default ResultEntryImport;
